import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import BasicModal from '../modal/Modal';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

export default function Navbar() {
    const [open, setOpen] = React.useState(false);
    const handleOpen = () => setOpen(true);
    return (
        <Box sx={{ flexGrow: 1 }} dire>
            <AppBar position="static" className='navbar-bg'>
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                        <img src="logo.png" style={{width: "50px", height: "50px", borderRadius: "50%"}} />
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        News
                    </Typography>
                    <Button color="inherit" onClick={handleOpen}><AccountCircleIcon /></Button>
                </Toolbar>
            <p style={{color: 'black'}}>viet ngu</p>
            <p style={{color: 'black'}}>viet ngu</p>
            </AppBar>
            <BasicModal open={open} setOpen={setOpen}/>
        </Box>
    );
}
